/********************************/
/* Stack                        */
/********************************/
struct stack
{
    /* Using an array of pointers and storing
    the base address reduces the heap memory
    consumption. Otherwise we have to store
    the array value and the offset */
    int **s;    // Array of pointers
    int *base;  // Array base
    int top;    // Stack top
    int size;   // Stack size

};

/***********************************************************************/
/* spush: Stack push                                                   */
/*                                                                     */
/***********************************************************************/
void spush(struct stack *s, int *height)
{
    /* Stack full cannot happen */
    if (s->top == s->size)
    {
        exit(-1);
        return;
    }

    /* If the height is same, then simply update the pointer. If
    there are several consecutive bars with the same height, then
    we need only the last one to calculate the area.  */
    if ((s->top) && ((*s->s[s->top - 1]) == *height))
        s->s[s->top - 1] = height;

    /* Else we push the height into the stack */
    else
    {
        s->s[s->top] = height;
        s->top++;
    }
}

/***********************************************************************/
/* spop: Stack do pop                                                  */
/*                                                                     */
/***********************************************************************/
int spop(struct stack *s, int *offst, int *height)
{
    /* Empty stack, return nothing */
    if (s->top == 0)
    {
        *offst = -1;
        return -1;
    }

    /* Else return the top pointer values */
    s->top--;
    *height = *s->s[s->top];

    /* Calculate the offset using the base address */
    *offst = s->s[s->top] - s->base;
    return 0;
}

/***********************************************************************/
/* speek: Peek into the stack top                                      */
/*                                                                     */
/***********************************************************************/
int speek(struct stack *s, int *offst, int *height)
{
    /* Empty stack */
    if (s->top == 0)
    {
        *offst = -1;
        return -1;
    }

    /* Return the top pointer values */
    *height = *s->s[s->top - 1];
    *offst = s->s[s->top - 1] - s->base;
    return 0;
}

/***********************************************************************/
/* Given n non-negative integers representing the histogram's bar      */
/* height where the width of each bar is 1, find the area of largest   */
/* rectangle in the histogram.                                         */
/*                                                                     */
/* URL : https://leetcode.com/problems/largest-rectangle-in-histogram/ */
/***********************************************************************/
int largestRectangleArea(int* heights, int heightsSize)
{
    int *a = heights;
    int n = heightsSize, i = 1, max_rectangle = -1, b, offst;
    struct stack s = {NULL, &a[0], 0, n};

    /* Maintain sanity */
    if (!a || !n)
        return 0;

    /* Best case */
    if (n == 1)
        return a[0];

    /* Another O(1) case */
    if (n == 2)
    {
        int min = a[0] > a[1] ? a[1] : a[0];

        /* If they are equal, then multiply by two */
        if (a[0] == a[1])
            return a[0] * 2;
        /* Else if the minimum is not zero */
        else if (min)
            return min * 2;
        /* Else return the non-zero value */
        else
            return (a[0] == 0) ? a[1] : a[0];
    }

    /* Allocate the stack */
    s.s = malloc(sizeof(int *) * s.size);
    if (!s.s)
        return 0;

    /* Push the first element into the stack */
    spush(&s, &a[0]);
    b = a[0];

    /* Scan all the elements */
    while (i < n)
    {
        /* The bar is higher than stack top, push
        into the stack */
        if (a[i] >= b)
        {
            spush(&s, &a[i]);
            b = a[i];
        }

        /* Else we need to calculate the area spanned by the
        bar on the top of the stack. */
        else
        {
            /* Peek while the stack top is less than the present
            bar */
            while ((speek(&s, &offst, &b) == 0) && (b > a[i]))
            {
                int loffst, ht;

                /* Pop and then peek into the stack to get the
                left offset */
                spop (&s, &offst, &b);
                speek(&s, &loffst, &ht);

                /* Update the max rectangle */
                if (max_rectangle < (b * ((i - loffst - 1))))
                    max_rectangle = b * (i - loffst - 1);
            }
            /* Push the bar into the stack */
            spush(&s, &a[i]);
            b = a[i];
        }
        /* Move to the next bar */
        ++i;
    }

    /* Pop the remaining bars */
    while (spop(&s, &offst, &b) == 0)
    {
        int loffst, ht;

        /* Update the area */
        speek(&s, &loffst, &ht);
        if (max_rectangle < (b * (i - loffst - 1)))
            max_rectangle = b * (i - loffst - 1);
    }
    /* Return maximum area */
    free(s.s);
    return max_rectangle;
}

#elif ENABLE_O_N2
/***********************************************************************/
/* Given n non-negative integers representing the histogram's bar      */
/* height where the width of each bar is 1, find the area of largest   */
/* rectangle in the histogram.                                         */
/*                                                                     */
/* URL : https://leetcode.com/problems/largest-rectangle-in-histogram/ */
/***********************************************************************/
int largestRectangleArea(int* heights, int heightsSize)
{
    int *a = heights;
    int n = heightsSize;
    int i, max_rectangle = 0;
    int *smaller_left, *smaller_right;

    /* Maintain sanity */
    if (!a || !n)
        return 0;

    /* Best case */
    if (a && (n == 1))
        return a[0];

    /* For every bar, finding the largest rectangle with its height
    requires us to find the next smallest bar to the left and right.

    Area = (Right_bar_offset - Left_bar_offset + 1) * Bar_height

    Sequentially scanning the left and right sub-array for each element
    leads to worst case O(n^2). But by memorizing the smaller left and
    right offsets for each element, we can reduce the comparisons */


    /* Allocate the array for memoization */
    smaller_left = malloc(sizeof(int) * (n + 1));
    if (smaller_left == NULL)
        return 0;
    smaller_right = malloc(sizeof(int) * (n + 1));
    if (smaller_right == NULL)
        return 0;

    /* First element has no left smaller element, last element has no
    right smaller */
    smaller_left[0] = -1;
    smaller_right[n - 1] = n;
    for (i = 1; i < n; ++i)
    {
        /* Best case */
        if (a[i] > a[i - 1])
            smaller_left[i] = i - 1;

        /* Else scan the array */
        else
        {
            int x = i - 1;
            /* Look for the next smaller element towards the left */
            while ((x >= 0) && (a[x] >= a[i]))
                x = smaller_left[x];

            /* Found the offset for the next smaller element */
            smaller_left[i] = x;
        }
    }


    /* Generate the offsets for smaller elements to the right */
    for (i = n - 2; i >= 0; --i)
    {
        /* Best case */
        if (a[i + 1] < a[i])
            smaller_right[i] = i + 1;

        /* Else scan the array */
        else
        {
            int x = i + 1;

            /* Loop as long as the values at the offsets are greater
            than a[i] */
            while ((x < n) && (a[x] >= a[i]))
                x = smaller_right[x];

            /* Smaller to the right */
            smaller_right[i] = x;
        }
    }

    /* O(n) scan to get the maximum area */
    for (i = 0; i < n; i++)
    {
        int mi = a[i] * (smaller_right[i] - smaller_left[i] - 1);
        if (max_rectangle < mi)
            max_rectangle = mi;
    }

    /* Return maximum area */
    return max_rectangle;
}
#endif

